import React from 'react'
import Col from 'react-bootstrap/Col'

const ArticleListItem = (props) =>{
    const {
      title, 
      body, 
      id,
      onClick
    } = props
    return (
      <Col xs={4}>
        <p>{id}</p>
        <p>{title}</p>
        <p>{body}</p>
        <button onClick={onClick}>delete</button>
        </Col>
    )
} 

export default ArticleListItem
